import React from 'react'
import '../styles/Body.css';
import Slider from "react-slick";
import "slick-carousel/slick/slick.css"; 
import "slick-carousel/slick/slick-theme.css";


export const Body = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 3,
    slidesToScroll: 3
  };
  return (
    <>
        <div className='body-container'>
            <div class="slider">
                <Slider {...settings}>

                </Slider>
            </div>
        </div>
    </>
  )
}
